#import "NuclideDataController.h"
#import "Nuclides.h"

@interface NuclideDataController ()
@property (nonatomic, readonly) NSMutableArray *nuclideList;
-(void) initializeDefaultNuclides;

@end


@implementation NuclideDataController

-(id) init {
    self = [super init];
    if (self) {
        _nuclideList=[[NSMutableArray alloc] init];
        [self initializeDefaultNuclides];
        return self;
    }
    return nil;
}

