    [self addNuclideWithNuclide:@"ununbium" nuclide:@"                                    112-Uub\r                                 112-ununbium\r\rElement 112 (Uub-277) was discovered on 9th February 1996 at the GSI in\rDarmstadt, Germany. A few atoms was made by fusing Zn-70 with Pb-208.\rUub-277 decays with alpha to Uun-273 with half life 280 μ sec and alpha energy\r11.45 MeV.\rFor further detail, refer to Press_Release of GSI.\r\r\rNATURALLY OCCURRING ISOTOPES:\r ISOTOPES:\r "];
