    [self addNuclideWithNuclide:@"ununoctium" nuclide:@"                                    118-Uuo\r                                118-ununoctium\r\rElement 118 disappears two years after it was discovered\r2 August 2001\rNB: The paper reporting the discovery of element 118 was formally retracted by\rits authors in 2002. The retraction followed an investigation into alleged\rscientific misconduct by one of the authors, Victor Ninov.\rResearchers at the Lawrence Berkeley National Laboratory in the US have\rretracted their claim to have discovered element 118. The retraction follows\rmore detailed analysis of the original data at Berkeley and the failure of\rexperiments at Berkeley, the RIKEN laboratory in Japan, and the GSI laboratory\rin Germany to observe the element.\rFor more information, visit Physics_Web.\r\r\rNATURALLY OCCURRING ISOTOPES:\r ISOTOPES:\r "];
    [self addNuclideWithNuclide:@"ununpentium" nuclide:@"                                    115-Uup\r                                115-ununpentium\r\rElements 115 and 113 discovered in Dubna\r3 February 2004\rA team of Russian and American physicists that discovered elements 114 and 116\rin 1998 and 2000 now believe they may have created two other superheavy\relements - 113 and 115. If confirmed, these results would lend even more weight\rto the idea of an _island of stability_ at the edge of the periodic table (Y\rOganessian et al. 2003 Phys. Rev. C 69 021601)\rFor more information, visit Physics_Web.\r\r\rNATURALLY OCCURRING ISOTOPES:\r ISOTOPES:\r "];
    [self addNuclideWithNuclide:@"ununquadium" nuclide:@"                                    114-Uuq\r                                114-ununquadium\r\rDubna lab finds second isotope of element 114\r16 July 1999\rThe_island of stability_- for many years an uninhabited region in the chart of\rthe nuclides - has started to look decidedly crowded. Atoms heavier than\ruranium tend to be very short-lived but theorists have predicted that there is\ra region of very stable heavy nuclei. The most stable of these superheavy\rnuclei is thought to have 114 protons and 184 neutrons. In January a long-lived\risotope with 114 protons and 175 neutrons was detected at the Flerov_Laboratory\rof Nuclear Reactions (JINR) in Dubna, Russia. In June elements 116 and 118 were\rdetected at the Lawrence_Berkeley_National_Laboratory in California. Now a\rsecond isotope of element 114 - one with 173 neutrons - has been detected at\rDubna (Nature 400 242).\rFor more information, visit Physics_Web.\r\rIsotopes:\rUuq-287   Uuq-289  \r___________________________________________\r\r\rNATURALLY OCCURRING ISOTOPES:\r ISOTOPES:\r                                  114-Uuq-287\r___________________________________________\r                              114-ununquadium-287\rNo information found.\r                                  114-Uuq-289\r___________________________________________\r                              114-ununquadium-289\r\rDubna lab finds second isotope of element 114\r16 July 1999\rThe_island of stability_- for many years an uninhabited region in the chart of\rthe nuclides - has started to look decidedly crowded. Atoms heavier than\ruranium tend to be very short-lived but theorists have predicted that there is\ra region of very stable heavy nuclei. The most stable of these superheavy\rnuclei is thought to have 114 protons and 184 neutrons. In January a long-lived\risotope with 114 protons and 175 neutrons was detected at the Flerov_Laboratory\rof Nuclear Reactions (JINR) in Dubna, Russia. In June elements 116 and 118 were\rdetected at the Lawrence_Berkeley_National_Laboratory in California. Now a\rsecond isotope of element 114 - one with 173 neutrons - has been detected at\rDubna (Nature 400 242).\rFor more information, visit Physics_Web.\r"];
