    [self addNuclideWithNuclide:@"ununtrium" nuclide:@"                                    113-Uut\r                                 113-ununtrium\r\rElements 115 and 113 discovered in Dubna\r3 February 2004\rA team of Russian and American physicists that discovered elements 114 and 116\rin 1998 and 2000 now believe they may have created two other superheavy\relements - 113 and 115. If confirmed, these results would lend even more weight\rto the idea of an _island of stability_ at the edge of the periodic table (Y\rOganessian et al. 2003 Phys. Rev. C 69 021601)\rFor more information, visit Physics_Web.\r\r\rNATURALLY OCCURRING ISOTOPES:\r ISOTOPES:\r "];
