-(void)addNuclideWithNuclide:(NSString *)element nuclide:(NSString *)nuclide {
    Nuclides *newNuclide = [[Nuclides alloc] initWithNuclide:element nuclide:nuclide];
    [self.nuclideList addObject:newNuclide];
}

-(NSUInteger)nuclideCount {
    return [self.nuclideList count];
}

-(Nuclides *)nuclideAtIndex:(NSUInteger)index {
    return [self.nuclideList objectAtIndex:index];
}

@end

